package desafio.gbx.desafio.entity;import jakarta.persistence.*;import lombok.Data;import java.time.LocalDateTime;@Data@Entitypublic class TransacaoEntity {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private long id;    @ManyToOne    private UsuarioEntity contaOrigem;    @ManyToOne    private UsuarioEntity contaDestino;    private double valor;    private LocalDateTime data;}